import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <h1>Authentication Service</h1>
      </header>
      <div className='box'>
        <button className='Auth_button'>
          <a href='http://localhost:3001/auth/google'>Login with Google</a>
        </button>
        <button className='Auth_button'>
          <a href='http://localhost:3001/auth/twitter'>Login with Twitter</a>
        </button>
      </div>



    </div>
  );
}

export default App;
